import logo from './logoAccretion.svg'; 
import './Header.css';

function Header () {
    return (
        <header className="header">
            <img 
                src={logo} 
                className="header_logo"
            />
            <button className="header_button">
                Buy
            </button>
            <button className="header_button">
                Sell
            </button>
            <button className="header_button">
                About Us
            </button>
        </header>
    )
}

export default Header;
